INSERT INTO `Licoes` (`id`, `nome`, `slug`, `idMantenedorCriou`, `idMantenedorAlterou`, `textoLicao`) VALUES
(1, 'Bem-vindo ao ExpertsAR (Leia Tudo)', 'bem-vindo-ao-expertsar-leia-tudo', 1, 1, '<p style=\"text-align: center;\"><strong>Por favor, leia todas as instru&ccedil;&otilde;es antes de avan&ccedil;ar.</strong></p>\r\n<p>Ol&aacute;, seja bem-vindo ao nosso site. Aqui voc&ecirc; aprender&aacute; &Aacute;lgebra Relacional, de forma f&aacute;cil, r&aacute;pida e intuitiva.</p>\r\n<h5>O que eu preciso saber antes de entrar no site?</h5>\r\n<p>Basicamente, no&ccedil;&otilde;es de Banco de Dados, como:</p>\r\n<ol>\r\n<li>O que &eacute; uma tabela;</li>\r\n<li>O que &eacute; uma tupla;</li>\r\n<li>O que &eacute; uma coluna e</li>\r\n<li>O que &eacute; um modelo relacional de Banco de Dados.</li>\r\n</ol>\r\n<h5>Ok, mas aonde eu estou?</h5>\r\n<p>Voc&ecirc; est&aacute; na nossa p&aacute;gina de li&ccedil;&otilde;es. &Eacute; neste ambiente que voc&ecirc; vai aprender os nossos conte&uacute;dos e testar seus conhecimentos.</p>\r\n<p>Toda li&ccedil;&atilde;o tem um texto explicativo, e nele voc&ecirc; vai aprender o conte&uacute;do. Logo ap&oacute;s, voc&ecirc; responder&aacute; perguntas, que representam consultas reais ao Banco de Dados.</p>\r\n<h5>Esta li&ccedil;&atilde;o tem perguntas?</h5>\r\n<p>N&atilde;o. A partir da pr&oacute;xima li&ccedil;&atilde;o, haver&aacute; perguntas.</p>\r\n<h5>S&oacute; vi uma li&ccedil;&atilde;o na minha p&aacute;gina, &eacute; normal?</h5>\r\n<p>&Eacute; normal. A pr&oacute;xima li&ccedil;&atilde;o s&oacute; aparece quando voc&ecirc; termina a li&ccedil;&atilde;o. Para concluir a li&ccedil;&atilde;o, voc&ecirc; dever&aacute; ler o texto e responder todas as nossas perguntas que forem fornecidas (P.S.:N&atilde;o acesse qualquer outra p&aacute;gina dentro do nosso site enquanto acessa uma li&ccedil;&atilde;o, sen&atilde;o, n&atilde;o poderemos dar como conclu&iacute;da a li&ccedil;&atilde;o).</p>\r\n<h5>Quantas perguntas ter&atilde;o em cada li&ccedil;&atilde;o?</h5>\r\n<p>Em uma li&ccedil;&atilde;o normal, de 3 a 6 perguntas. Em uma li&ccedil;&atilde;o de refor&ccedil;o, de 5 a 10 perguntas.</p>\r\n<h5>Ok, mas como verei o meu progresso?</h5>\r\n<p>Na p&aacute;gina inicial, voc&ecirc; poder&aacute; olhar no canto superior direito quantas li&ccedil;&otilde;es voc&ecirc; concluiu e quantas li&ccedil;&otilde;es faltam para terminar.</p>\r\n<p><img class=\"responsive-img\" src=\"../images/progresso.png\" alt=\"Progresso\" /></p>\r\n<p><em>Imagem meramente ilustrativa</em></p>\r\n<h5>O que faz o bot&atilde;o OL&Aacute; &lt; SEUNOME &gt; ou o bot&atilde;o hamb&uacute;rger (<em class=\"material-icons\">menu</em>), presentes na minha p&aacute;gina inicial?</h5>\r\n<p>Ao tocar em um desses bot&otilde;es, voc&ecirc; abre o menu do sistema, com diversas op&ccedil;&otilde;es adicionais.</p>\r\n<p><img class=\"responsive-img\" src=\"../images/bar.png\" alt=\"Menu do Sistema\" /></p>\r\n<h5>Tenho d&uacute;vidas e sugest&otilde;es, o que fa&ccedil;o?</h5>\r\n<p>Para ver mais informa&ccedil;&otilde;es sobre o site, abra o nosso menu (ap&oacute;s concluir a li&ccedil;&atilde;o) e clique em \"Ajuda\". Nele, voc&ecirc; ter&aacute; mais informa&ccedil;&otilde;es sobre o nosso site.</p>\r\n<p style=\"text-align: left;\">Se voc&ecirc; tem alguma d&uacute;vida, sugest&atilde;o ou cr&iacute;tica, use nosso sistema de contato (Menu &gt; Contato) para mandar para a gente.</p>\r\n<p style=\"text-align: left;\">---</p>\r\n<h5 style=\"text-align: center;\">Termina aqui nossas informa&ccedil;&otilde;es iniciais. Desejamos bom proveito a voc&ecirc; na sua jornada! Para terminar esta li&ccedil;&atilde;o, clique em \"Avan&ccedil;ar\", no canto superior direito dessa janela.</h5>'),
(2, 'Apresentando o BD Locadora', 'apresentando-o-bd-locadora', 1, 1, '<p style=\"text-align: center;\">Neste texto, voc&ecirc; ter&aacute; mais detalhes do Banco de Dados a ser usado de exemplo em nossos exerc&iacute;cios. Preste muita aten&ccedil;&atilde;o aos detalhes, eles poder&atilde;o ser &uacute;teis.</p>\r\n<h5 style=\"text-align: left;\">Introdu&ccedil;&atilde;o</h5>\r\n<p>A locadora \"V&iacute;deoTape\", presente h&aacute; mais de 20 anos na cidade, decidiu criar um sistema modernizado que tivesse com os seguintes requisitos:</p>\r\n<ol>\r\n<li>O sistema deve gerenciar todas as fitas que est&atilde;o no acervo da loja;</li>\r\n<li>O sistema deve gerenciar as loca&ccedil;&otilde;es e os seus pagamentos;</li>\r\n<li>O sistema deve gerenciar os clientes e seus dependentes e</li>\r\n<li>O sistema deve oferecer uma estrutura para que um filme seja pesquisado pelo seu nome, pelo seu g&ecirc;nero e at&eacute; mesmo, pelos artistas que participam do filme.</li>\r\n</ol>\r\n<p>Ap&oacute;s levantar os requisitos, o analista tra&ccedil;ou o <a href=\"http://www.devmedia.com.br/modelo-entidade-relacionamento-mer-e-diagrama-entidade-relacionamento-der/14332\" target=\"_blank\" rel=\"noopener noreferrer\">Diagrama de Entidade e Relacionamento (DER)</a> para o sistema da locadora. Ele est&aacute; apresentado abaixo:</p>\r\n<p><a href=\"images/locadora.png\" target=\"_blank\" rel=\"noopener noreferrer\"><img class=\"responsive-img\" src=\"../images/locadora.png\" /></a></p>\r\n<p><em>Obs.: Clique na imagem para abrir em nova janela.</em></p>\r\n<p>A seguir, o diagrama do banco de dados na nota&ccedil;&atilde;o de engenharia de informa&ccedil;&otilde;es:</p>\r\n<p><a href=\"../images/locadoraER.png\" target=\"_blank\" rel=\"noopener noreferrer\"><img class=\"responsive-img\" src=\"../images/locadoraER.png\" alt=\"Diagrama na nota&ccedil;&atilde;o de Engenharia de Informa&ccedil;&otilde;es da Locadora\" /></a></p>\r\n<p><em>Obs.: Clique na imagem&nbsp;</em><em>para&nbsp;abrir em nova janela</em><em>.</em></p>\r\n<blockquote>\r\n<p>Observa&ccedil;&otilde;es em rela&ccedil;&atilde;o das colunas com tipos UNKNOWN e OTHER:</p>\r\n<p>&gt; A coluna <span style=\"text-decoration: underline;\">sexo</span> (tabela <span style=\"text-decoration: underline;\">artista</span>), aceita apenas valores M (Masculino) ou F (Feminino);</p>\r\n<p>&gt; A forma de pagamento de loca&ccedil;&otilde;es (coluna <span style=\"text-decoration: underline;\">formapagto</span> da tabela <span style=\"text-decoration: underline;\">cliente</span>) do cliente assume os seguintes valores: 32 (quando ele paga na retirada), 0 (quando ele paga na devolu&ccedil;&atilde;o) ou o dia do m&ecirc;s (quando ele paga as loca&ccedil;&otilde;es mensalmente;</p>\r\n<p>&gt; A coluna <span style=\"text-decoration: underline;\">dub_leg</span> da tabela <span style=\"text-decoration: underline;\">fita</span> recebe apenas os valores D quando a fita &eacute; dublada ou L quando a fita for legendada.</p>\r\n</blockquote>\r\n<h5>Esquema Textual</h5>\r\n<p>A seguir, o <a href=\"https://alexevalerio.wordpress.com/2014/04/11/modelagem-de-banco-de-dados-esquema-textual/\">Esquema Textual</a> do banco de dados modelado:</p>\r\n<p>cliente (<strong><u>idcli</u></strong>,nomecli,RG,CPF,dtnasc,dtadm,formapagto,idcliresp)</p>\r\n<p>locacao (<strong><u>idloc</u></strong>, idcli, dtretirada, dtdevolprev, dtdevolreal, idct)</p>\r\n<p>itemloc (<strong><u>iditloc</u></strong>, <u>idloc, idfil, ordfita</u>, valorlocfita)</p>\r\n<p>filme (<strong><u>idfil</u></strong>, <u>nomefil, ano</u>, idgen, censura, idprod, pais, durminut, precoloc)</p>\r\n<p>fita (<strong><u>idfil, ordfita</u></strong>, precocusto, dtaquis, estadoconserv, dub_leg)</p>\r\n<p>filbaixa (<strong><u>idfil, ordfita</u></strong>, dtbaixa, idct)</p>\r\n<p>artista (<strong><u>idart</u></strong>, nomeart, sexo)</p>\r\n<p>particip (<strong><u>idpart</u></strong>, nomepart)</p>\r\n<p>filpart (<strong><u>idfil, idart, idpart</u></strong>)</p>\r\n<p>conta (<strong><u>idct</u></strong>, dtlanc, historico, valor, dtvenc, idtpct)</p>\r\n<p>contaliq (<strong><u>idct</u></strong>, dtliq, valorliq)</p>\r\n<p>tipoconta (<strong><u>idtpct</u></strong>, nometpct)</p>\r\n<p>genero (<strong><u>idgen</u></strong>, nomegen)</p>\r\n<p>produtora (<strong><u>idprod</u></strong>, nomeprod)</p>\r\n<p>&nbsp;</p>\r\n<p>A seguir, vamos mostrar alguns detalhes de algumas tabelas do banco de dados.</p>\r\n<h5>Detalhes</h5>\r\n<h6><strong>Clientes</strong></h6>\r\n<p>Para a tabela Cliente s&atilde;o adicionadas as restri&ccedil;&otilde;es:</p>\r\n<ol>\r\n<li>a idade do cliente deve ser, no m&iacute;nimo, 5 anos;</li>\r\n<li>a idade do respons&aacute;vel n&atilde;o pode ser inferior a 18 anos;</li>\r\n<li>a data de admiss&atilde;o &eacute; a data do sistema;</li>\r\n<li>a forma de pagamento de loca&ccedil;&otilde;es do cliente assume os seguintes valores: 32 (quando ele paga na retirada), 0 (quando ele paga na devolu&ccedil;&atilde;o) ou o dia do m&ecirc;s (quando ele paga as loca&ccedil;&otilde;es mensalmente).</li>\r\n</ol>\r\n<h6><strong>Filmes</strong></h6>\r\n<ol>\r\n<li>A concatena&ccedil;&atilde;o de nomefil com ano tamb&eacute;m &eacute; chave de filme</li>\r\n<li>Os atributos durminut e dub_leg admitem nulos</li>\r\n<li>O atributo precoloc foi acrescido em Filme para armazenar o pre&ccedil;o atual de loca&ccedil;&atilde;o daquele filme (podendo ser, portanto, diferente do valorlocfita de ItemLoc.</li>\r\n</ol>\r\n<h6><strong>Contas</strong></h6>\r\n<ol>\r\n<li>TipoConta assume os seguintes valores (idtpct, nometpct) = { (1, Loca&ccedil;&atilde;o), (2, Baixa com venda), (3, Multa), (4, Outro cr&eacute;dito), (5, Aquisi&ccedil;&atilde;o),&nbsp; (6, Pessoal), (7, Manuten&ccedil;&atilde;o), (8, Pro-labore), (9, Outro d&eacute;bito) }</li>\r\n<li>Saiba que quando idtpct &lt; 5 trata-se de conta de cr&eacute;dito, sendo conta de d&eacute;bito no caso contr&aacute;rio;</li>\r\n<li>Cada tupla de ContaLiq refere-se a uma tupla de Conta, que j&aacute; foi paga.</li>\r\n</ol>\r\n<h6><strong>Loca&ccedil;&otilde;es</strong></h6>\r\n<ol>\r\n<li>O atributo dtdevolreal admite nulos</li>\r\n<li>A concatena&ccedil;&atilde;o idloc+idfil+ordfita tamb&eacute;m &eacute; chave da tabela ItemLoc</li>\r\n<li>O atributo valorlocfita n&atilde;o admite nulos mas &eacute; iniciado com zero enquanto a fita da loca&ccedil;&atilde;o n&atilde;o &eacute; paga ou &eacute; uma fita locada gratuitamente</li>\r\n<li>Refor&ccedil;a-se que, para as contas de loca&ccedil;&atilde;o, a soma de valorlocfita de uma loca&ccedil;&atilde;o corresponde ao valorliq de ContaLiq (e foi colocado no projeto do banco de dados desta forma por exig&ecirc;ncia de desempenho no acesso ao banco de dados).</li>\r\n</ol>\r\n<h6><strong>Particip</strong></h6>\r\n<p>Esta tabela &eacute; utilizada para indicar o tipo de participa&ccedil;&atilde;o do artista no filme, e assume os valores:</p>\r\n<p>Particip ( <span style=\"text-decoration: underline;\">idpart</span>, nomepart ) = {<br />&nbsp;&nbsp;&nbsp; (1, \'Diretor(a)\'), (2, \'Ator Principal\'),&nbsp; (3, \'Atriz Principal\'), (4, \'Ator Coadjuvante\'), (5, \'Atriz Coadjuvante\'), (6, \'Ator Secund&aacute;rio\'), (7, \'Atriz Secund&aacute;ria\'), (8, \'Produtor(a)\')<br />&nbsp;}</p>\r\n<h5>Considera&ccedil;&otilde;es Finais</h5>\r\n<p>Terminamos aqui a apresenta&ccedil;&atilde;o do banco de dados a ser utilizado neste trabalho. Vale lembrar que se voc&ecirc; tiver alguma d&uacute;vida em rela&ccedil;&atilde;o ao modelo, basta clicar no bot&atilde;o \"Tabelas do Banco de Dados Locadora\", localizado acima da barra de bot&otilde;es, quando voc&ecirc; fazer um exerc&iacute;cio.</p>'),
(3, 'IntroduÃ§Ã£o ao Operador ProjeÃ§Ã£o', 'introducao-ao-operador-projecao', 1, 1, '<p>Nesta li&ccedil;&atilde;o, voc&ecirc; vai aprender sobre o operador proje&ccedil;&atilde;o, um dos dois operadores b&aacute;sicos. Mas antes, vamos aprender o que &eacute; a &Aacute;lgebra Relacional.</p>\r\n<h5>O que &eacute; &Aacute;lgebra Relacional</h5>\r\n<p>A &Aacute;lgebra Relacional &eacute; uma linguagem de consultas a banco de dados. Foi inventado por Edgar Codd, enquanto trabalhava na IBM. Ele define opera&ccedil;&otilde;es b&aacute;sicas de recupera&ccedil;&atilde;o de informa&ccedil;&otilde;es em um banco de dados.</p>\r\n<h5>Rela&ccedil;&atilde;o</h5>\r\n<p>Para entender &Aacute;lgebra Relacional, voc&ecirc; deve entender o que &eacute; uma rela&ccedil;&atilde;o. Os operadores de &Aacute;lgebra Relacional atuam sobre rela&ccedil;&otilde;es, que geram novas rela&ccedil;&otilde;es. <strong>Assim, uma tabela sozinha &eacute; considerada uma rela&ccedil;&atilde;o assim como uma opera&ccedil;&atilde;o complexa, de v&aacute;rios operadores</strong>.</p>\r\n<h5>O Operador Proje&ccedil;&atilde;o</h5>\r\n<p>O Operador Proje&ccedil;&atilde;o &eacute; um das opera&ccedil;&otilde;es elementares da &Aacute;lgebra Relacional. Consiste em selecionar em quais colunas ser&atilde;o exibidas em uma rela&ccedil;&atilde;o. Sua sintaxe &eacute;:</p>\r\n<p><code>&Pi; coluna1, coluna2, ..., coluna(Rela&ccedil;&atilde;o)</code></p>\r\n<p style=\"text-align: left;\">Vamos a um exemplo, suponha&nbsp;que voc&ecirc; queira selecionar apenas os ids dos clientes. Para isso, basta apenas fazer a seguinte consulta:</p>\r\n<p style=\"text-align: left;\"><code>&Pi; idcli (cliente)</code></p>\r\n<p style=\"text-align: left;\">Retorna os seguintes resultados:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idcli</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">(...)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: left;\">Para selecionar mais de uma coluna, basta espec&iacute;ficar com v&iacute;rgulas.</p>\r\n<p style=\"text-align: left;\">Ex.: Selecione o&nbsp;pre&ccedil;o de custo, a data de aquisi&ccedil;&atilde;o e o estado de conserva&ccedil;&atilde;o de cada fita cadastrada no sistema:</p>\r\n<p style=\"text-align: left;\"><code>&Pi; precocusto, dtaquis, estadoconserv(fita)</code></p>\r\n<blockquote>\r\n<p style=\"text-align: left;\"><strong>E se quero selecionar todas as colunas?</strong> Basta apenas especificar o nome da tabela.</p>\r\n<p style=\"text-align: left;\">Ex: Para ter todos os itens da tabela fita, basta digitar:&nbsp;<code>fita</code></p>\r\n</blockquote>\r\n<p style=\"text-align: left;\">A seguir, voc&ecirc; vai resolver alguns exerc&iacute;cios sobre esse importante operador da &Aacute;lgebra Relacional.</p>'),
(4, 'IntroduÃ§Ã£o ao Operador SeleÃ§Ã£o', 'introducao-ao-operador-selecao', 1, 1, '<h5>Introdu&ccedil;&atilde;o</h5>\r\n<p>Ao contr&aacute;rio do operador Proje&ccedil;&atilde;o (&Pi;), que seleciona colunas a serem exibidas na rela&ccedil;&atilde;p, o operador Sele&ccedil;&atilde;o (&sigma; - sigma m&iacute;nusculo) seleciona quais linhas a serem exibidas na rela&ccedil;&atilde;o que se enquadram em uma determinada condi&ccedil;&atilde;o. Sua sintaxe &eacute;:</p>\r\n<p><code>&sigma; condicao (relacao)</code></p>\r\n<h5>Como escrever condi&ccedil;&otilde;es em &Aacute;lgebra Relacional?</h5>\r\n<p>As condi&ccedil;&otilde;es s&atilde;o [quase] escritas da mesma forma que em Linguagens de Programa&ccedil;&atilde;o, onde voc&ecirc; escreve testes. Na &Aacute;lgebra Relacional (e tamb&eacute;m no SQL), esses testes testam valores em colunas da rela&ccedil;&atilde;o. S&atilde;o operadores de condi&ccedil;&atilde;o:</p>\r\n<table border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>S&iacute;mbolo</strong></td>\r\n<td style=\"text-align: center;\"><strong>Significado</strong></td>\r\n<td style=\"text-align: center;\"><strong>Exemplo</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">&gt;</td>\r\n<td style=\"text-align: center;\">Maior que</td>\r\n<td style=\"text-align: center;\"><code>id &gt; 9</code></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">&lt;</td>\r\n<td style=\"text-align: center;\">Menor que</td>\r\n<td style=\"text-align: center;\"><code>id &lt; 9</code></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">&ge;</td>\r\n<td style=\"text-align: center;\">Maior igual que</td>\r\n<td style=\"text-align: center;\"><code>id &ge; 9</code></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">&le;</td>\r\n<td style=\"text-align: center;\">Menor igual que</td>\r\n<td style=\"text-align: center;\"><code>id &le; 9</code></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">&ne;</td>\r\n<td style=\"text-align: center;\">Diferente</td>\r\n<td style=\"text-align: center;\"><code>id &ne; 99</code></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">=</td>\r\n<td style=\"text-align: center;\">Igual</td>\r\n<td style=\"text-align: center;\"><code>nome = \"Jo&atilde;o\"</code></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<blockquote>\r\n<p>Aten&ccedil;&atilde;o: Com exe&ccedil;&atilde;o do operador igual e do operador diferente (que aceitam strings), voc&ecirc; s&oacute; pode comparar valores num&eacute;ricos usando esses operadores.</p>\r\n<p>Para comparar datas no nosso site, digite a data como se fosse uma string do tipo \"aaaa-mm-dd\". Por exemplo: <code>data &lt; \"2017-05-28\"</code></p>\r\n</blockquote>\r\n<p>Para unir duas condi&ccedil;&otilde;es, voc&ecirc; pode usar os operadores â‹€ (E l&oacute;gico) e â‹ (ou l&oacute;gico). Para relembrar:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>Operador 1</strong></td>\r\n<td style=\"text-align: center;\"><strong>Operador 2</strong></td>\r\n<td style=\"text-align: center;\"><strong>Operador1 â‹€ Operador2</strong></td>\r\n<td style=\"text-align: center;\"><strong>Operador1 â‹ Operador2</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">VERDADEIRO</td>\r\n<td style=\"text-align: center;\">VERDADEIRO</td>\r\n<td style=\"text-align: center;\">VERDADEIRO</td>\r\n<td style=\"text-align: center;\">VERDADEIRO</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">VERDADEIRO</td>\r\n<td style=\"text-align: center;\">FALSO</td>\r\n<td style=\"text-align: center;\">FALSO</td>\r\n<td style=\"text-align: center;\">VERDADEIRO</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">FALSO</td>\r\n<td style=\"text-align: center;\">VERDADEIRO</td>\r\n<td style=\"text-align: center;\">FALSO</td>\r\n<td style=\"text-align: center;\">VERDADEIRO</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">FALSO</td>\r\n<td style=\"text-align: center;\">FALSO</td>\r\n<td style=\"text-align: center;\">FALSO</td>\r\n<td style=\"text-align: center;\">FALSO</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h5>Exemplos</h5>\r\n<p><strong>Selecione todos os clientes que possuem id maior que 9</strong></p>\r\n<p><code>&sigma; idcli &gt; 9 (cliente)</code></p>\r\n<p><strong>Selecione todos os clientes que possume id maior que 5 e que sua forma de pagamento n&atilde;o seja no dia da devolu&ccedil;&atilde;o (ou seja, a coluna formapagto n&atilde;o tenha valor 0)</strong></p>\r\n<p><code>&sigma; idcli &gt; 5 â‹€ formapagto &ne; 0 (cliente)</code><strong><br /></strong></p>\r\n<p>&nbsp;</p>'),
(5, 'Consultas envolvendo ProjeÃ§Ã£o e SeleÃ§Ã£o', 'consultas-envolvendo-projecao-e-selecao', 1, 1, '<p>Nesta li&ccedil;&atilde;o, voc&ecirc; vai aprender exerc&iacute;cios que envolva proje&ccedil;&atilde;o e sele&ccedil;&atilde;o.</p>\r\n<p>Para relembrar:</p>\r\n<p><strong>Proje&ccedil;&atilde;o:</strong> <code>&Pi; coluna1, coluna2, ..., colunaN(rela&ccedil;&atilde;o)</code></p>\r\n<p><strong>Sele&ccedil;&atilde;o:</strong> <code>&sigma; condicao(rela&ccedil;&atilde;o)</code></p>\r\n<p>&Eacute; considerado uma rela&ccedil;&atilde;o uma tabela ou um resultado de uma consulta. Assim, consultas podem ser aninhadas. Veja esse exemplo:</p>\r\n<p><code>&Pi; idcli (&sigma; idcli &gt; 9 (cliente))</code></p>'),
(6, 'Como fazer atribuiÃ§Ã£o de consultas', 'como-fazer-atribuicao-de-consultas', 1, 1, '<p>A atribui&ccedil;&atilde;o de consultas &eacute; algo importante na &Aacute;lgebra Relacional, pois permite organizar queries complexas em v&aacute;rias linhas, separando em v&aacute;rias etapas, tornando ela mais leg&iacute;vel. Nesse caso, as rela&ccedil;&otilde;es s&atilde;o atribu&iacute;das a identificadores, de forma an&aacute;loga a uma vari&aacute;vel na linguagem de programa&ccedil;&atilde;o. Na &Aacute;lgebra Relacional, o s&iacute;mbolo de atribui&ccedil;&atilde;o &eacute; a seta (&larr;).</p>\r\n<p>Ex.: <code>{identificador} &larr; {relacao}</code></p>\r\n<p>Reiteramos novamente que uma rela&ccedil;&atilde;o pode ser um nome de tabela ou um resultado de uma consulta em &Aacute;lgebra Relacional.</p>\r\n<blockquote>\r\n<p>Na &Aacute;lgebra Relacional Formal, n&atilde;o existe um padr&atilde;o para identificadores. Mas neste site, vamos convencionar que um identificador deve obedecer as seguintes regras:</p>\r\n<ol>\r\n<li>Deve come&ccedil;ar com uma letra;</li>\r\n<li>Deve ter mais de um caractere;</li>\r\n<li>A partir do segundo caracter, deve ter letras, n&uacute;meros, <em>underlines</em> (_) ou cifr&otilde;es ($).</li>\r\n</ol>\r\n</blockquote>\r\n<p>Vale lembrar que o uso desse recurso &eacute; opicional. Nada impede que voc&ecirc; estruture sua consulta em uma linha s&oacute;.</p>\r\n<p><strong>Exemplo: </strong>Selecione os nomes dos clientes que nasceram depois do dia 12 de Junho de 1985:</p>\r\n<p><code>&Pi; nomecli (&sigma; dtnasc &gt; \"1985-06-12\"(cliente))</code></p>\r\n<p>OU</p>\r\n<p><code>SEL_1 &larr; &sigma; dtnasc &gt; \"1985-06-12\"(cliente)</code></p>\r\n<p><code>&Pi; nomecli (SEL_1)</code></p>\r\n<p>&nbsp;</p>'),
(7, 'UniÃ£o, InterseÃ§Ã£o e DiferenÃ§a', 'uniao-intersecao-e-diferenca', 1, 1, '<p>Nas li&ccedil;&otilde;es anteriores, voc&ecirc; aprendeu como usar os operadores proje&ccedil;&atilde;o e sele&ccedil;&atilde;o, que sozinhos, s&atilde;o aplicados somente em uma tabela. A partir de agora, voc&ecirc; vai aprender como colocar em uma mesma consulta, v&aacute;rias tabelas de um banco de dados. O primeiro conjunto de operadores que trabalham em duas rela&ccedil;&otilde;es s&atilde;o a uni&atilde;o, interse&ccedil;&atilde;o e diferen&ccedil;as, originadas da <a href=\"http://www.infoescola.com/matematica/teoria-dos-conjuntos/\" target=\"_blank\" rel=\"noopener noreferrer\">Teoria dos Conjuntos</a>. Esses operadores bin&aacute;rios (ou seja, trabalham com duas rela&ccedil;&otilde;es) fazem as seguintes opera&ccedil;&otilde;es:</p>\r\n<ol>\r\n<li><strong>Uni&atilde;o (&cup;): </strong>Dadas as rela&ccedil;&otilde;es A e B, a opera&ccedil;&atilde;o <code>A &cup; B</code> retorna todas as tuplas que estiverem em R ou em S ou em ambas as rela&ccedil;&otilde;es.</li>\r\n<li><strong>Intersec&ccedil;&atilde;o (&cap;): </strong>Dadas as mesmas rela&ccedil;&otilde;es A e B, uma opera&ccedil;&atilde;o <code>A &cap; B</code> retorna todas as tuplas que estiverem tanto na rela&ccedil;&atilde;o A quanto na rela&ccedil;&atilde;o B, ou seja, estejam presentes nas duas rela&ccedil;&otilde;es.</li>\r\n<li><strong>Diferen&ccedil;a ou Exceto (-):</strong> Sendo A e B rela&ccedil;&otilde;es, uma opera&ccedil;&atilde;o <code>A - B</code> retorna todas as tuplas que est&atilde;o em A <span style=\"text-decoration: underline;\">mas n&atilde;o est&atilde;o em</span> B.</li>\r\n</ol>\r\n<p>Graficamente, o resultado dessa opera&ccedil;&atilde;o se encontra na figura abaixo:</p>\r\n<p><img class=\"responsive-img\" src=\"../images/union.jpg\" alt=\"Uni&atilde;o, Intersec&ccedil;&atilde;o e Diferen&ccedil;a\" /></p>\r\n<p style=\"text-align: left;\"><em>Extra&iacute;do de&nbsp; <a href=\"http://www.ebah.com.br/content/ABAAAAsKMAB/matematica-basica\">http://www.ebah.com.br/content/ABAAAAsKMAB/matematica-basica</a>, acesso em 28 mai. 2017.</em></p>\r\n<p>H&aacute; algumas notas que devem ser lembradas com rela&ccedil;&atilde;o a estes operadores:</p>\r\n<ol>\r\n<li>Tanto na &Aacute;lgebra Relacional formal, quanto na SQL, uma opera&ccedil;&atilde;o envolvendo esses tr&ecirc;s operadores elimina automaticamente todas as duplicatas;</li>\r\n<li>As opera&ccedil;&otilde;es de Uni&atilde;o e Intersec&ccedil;&atilde;o s&atilde;o comutativas, ou seja: A &cup; B = B &cup; A e A &cap; B = B &cap; A;</li>\r\n<li>Isto n&atilde;o &eacute; v&aacute;lido para o operador Diferen&ccedil;a. Assim: A - B &ne; B - A;</li>\r\n<li>As opera&ccedil;&otilde;es de Uniao e Intersec&ccedil;&atilde;o s&atilde;o tamb&eacute;m associativas, ou seja: (A &cup; B) &cup; C = A &cup; (B &cup; C) e (A &cap; B) &cap; C = A &cap; (B &cap; C) e;</li>\r\n<li>Para que esses operadores sejam aplicados, as rela&ccedil;&otilde;es devem ser <strong>compat&iacute;veis pela uni&atilde;o</strong>, ou seja, obedecer as seguintes regras:\r\n<ol>\r\n<li>Devem ter o mesmo n&uacute;mero de colunas e;</li>\r\n<li>O dom&iacute;nio do atributo A<sub>i</sub> deve ser igual ao atributo B<sub>i</sub> para 1 &le; i &le; n. Assim, <span style=\"text-decoration: underline;\">cada par de atributos deve ter um mesmo tipo</span>. Ex: Se a primeira coluna da rela&ccedil;&atilde;o A for do tipo inteiro, a primeira coluna da rela&ccedil;&atilde;o B deve ser do tipo inteiro, e assim, sucessivamente.</li>\r\n</ol>\r\n</li>\r\n</ol>'),
(9, 'Produto Cartesiano e JunÃ§Ã£o Natural', 'produto-cartesiano-e-juncao-natural', 1, 1, '<blockquote>\r\n<p>Nesta li&ccedil;&atilde;o, voc&ecirc; ir&aacute; aprender sobre o Produto Cartesiano e a Jun&ccedil;&atilde;o Natural.</p>\r\n</blockquote>\r\n<h5>Produto Cartesiano</h5>\r\n<p>Tamb&eacute;m denominado de <strong>Produto Cruzado</strong> por alguns autores, &eacute; uma opera&ccedil;&atilde;o bin&aacute;ria, mas n&atilde;o obriga que as rela&ccedil;&otilde;es envolvidas sejam compat&iacute;veis pela uni&atilde;o. Seu funcionamento &eacute; bastante simples, dadas duas rela&ccedil;&otilde;es A e B, um produto cartesiano entre essas opera&ccedil;&otilde;es (denotada na express&atilde;o A X B) produz uma nova rela&ccedil;&atilde;o combinando cada tupla de A com cada tupla de B.&nbsp;</p>\r\n<p>Para ilustrar, observe estas duas rela&ccedil;&otilde;es:</p>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\">Rela&ccedil;&atilde;o Fabricante</span></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idFabricante</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeFabricante</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Microsoft</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Apple</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Adobe</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align: center;\"><span style=\"text-decoration: underline;\">Rela&ccedil;&atilde;o Software</span></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idSoft</strong></td>\r\n<td style=\"text-align: center;\"><strong>idFab</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeSoftware</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Acrobat Reader</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">iTunes</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Windows</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Uma opera&ccedil;&atilde;o Fabricante X Software geraria a seguinte rela&ccedil;&atilde;o:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idFabricante</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeFabricante</strong></td>\r\n<td style=\"text-align: center;\"><strong>idSoft</strong></td>\r\n<td style=\"text-align: center;\"><strong>idFab</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeSoftware</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Microsoft</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Acrobat Reader</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Microsoft</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">iTunes</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Microsoft</td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Windows</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Apple</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Acrobat Reader</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Apple</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">iTunes</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Apple</td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Windows</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Adobe</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Acrobat Reader</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Abobe</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">iTunes</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Adobe</td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Windows</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>A rela&ccedil;&atilde;o gerada tem cinco colunas, pois uniu as colunas das duas rela&ccedil;&otilde;es. Esta mesma rela&ccedil;&atilde;o tem nove tuplas, pois combinou as 3 tuplas da rela&ccedil;&atilde;o Fabricante com as tr&ecirc;s tuplas da rela&ccedil;&atilde;o Software. Assim, pela regra da combina&ccedil;&atilde;o, que voc&ecirc; viu em Probabilidade e Estat&iacute;sitca, o n&uacute;mero de tuplas finais &eacute; 3 X 3 = 9.</p>\r\n<p>Normalmente, &eacute; aplicado uma condi&ccedil;&atilde;o e/ou sele&ccedil;&atilde;o para filtrar os dados selecionados.</p>\r\n<p>Ex: Selecione os softwares produzidos pela Adobe:</p>\r\n<p><code>SOFT_FAB &larr; Fabricantes X Softwares</code></p>\r\n<p><code>&sigma; idFab = idFabricante â‹€ nomeFabricante = \"Adobe\" (SOFT_FAB)</code></p>\r\n<h5>Jun&ccedil;&atilde;o Natural</h5>\r\n<p>Para usar o Produto Cartesiano, &eacute; inevit&aacute;vel que seja usado uma proje&ccedil;&atilde;o ou sele&ccedil;&atilde;o para filtrar as tuplas resultantes, j&aacute; que essa opera&ccedil;&atilde;o, dependendo das dimens&otilde;es das rela&ccedil;&otilde;es (o n&uacute;mero de colunas e de tuplas que existem) podem retornar um n&uacute;mero elevado de tuplas. Mas existem outros operadores que combinam duas rela&ccedil;&otilde;es e fazem a filtragem autom&aacute;tica. Esses operadores fazem opera&ccedil;&otilde;es de <strong>Jun&ccedil;&atilde;o</strong>.</p>\r\n<p>H&aacute; v&aacute;rios tipos de jun&ccedil;&atilde;o, mas o mais simples deles &eacute; a Jun&ccedil;&atilde;o Natural (Denotada na forma A * B), que combina duas rela&ccedil;&otilde;es <span style=\"text-decoration: underline;\">que possuem um atributo com mesmo nome em comum</span>, filtrando as tuplas que possu&iacute;rem o mesmo valor nesse atributo.</p>\r\n<p>Vejamos um exemplo para ilustrar, vindo da <a href=\"https://pt.wikipedia.org/wiki/Jun%C3%A7%C3%A3o_natural\" target=\"_blank\" rel=\"noopener noreferrer\">Wikipedia (Artigo: Jun&ccedil;&atilde;o Natural)</a>.</p>\r\n<dl>\r\n<dt><span style=\"text-decoration: underline;\">Rela&ccedil;&atilde;o Marcas</span></dt>\r\n</dl>\r\n<table border=\"1\" width=\"200\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td bgcolor=\"#E5E5E5\">CODIGOMARCA</td>\r\n<td bgcolor=\"#E5E5E5\">NOMEMARCA</td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>Honda</td>\r\n</tr>\r\n<tr>\r\n<td>2</td>\r\n<td>Toyota</td>\r\n</tr>\r\n<tr>\r\n<td>3</td>\r\n<td>Nissan</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<dl>\r\n<dt><span style=\"text-decoration: underline;\">Rela&ccedil;&atilde;o Modelos</span></dt>\r\n</dl>\r\n<table border=\"1\" width=\"200\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td bgcolor=\"#E5E5E5\">CODIGOMODELO</td>\r\n<td bgcolor=\"#E5E5E5\">NOMEMODELO</td>\r\n<td bgcolor=\"#E5E5E5\">CODIGOMARCA</td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>Civic</td>\r\n<td>1</td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>Hilux</td>\r\n<td>2</td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>370Z</td>\r\n<td>3</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<dl>\r\n<dt>Fazendo a opera&ccedil;&atilde;o: Modelos * Marcas</dt>\r\n</dl>\r\n<table border=\"1\" width=\"200\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td bgcolor=\"#E5E5E5\">CODIGOMODELO</td>\r\n<td bgcolor=\"#E5E5E5\">NOMEMODELO</td>\r\n<td bgcolor=\"#E5E5E5\">CODIGOMARCA</td>\r\n<td bgcolor=\"#E5E5E5\">NOMEMARCA</td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>Civic</td>\r\n<td>1</td>\r\n<td>Honda</td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>Hilux</td>\r\n<td>2</td>\r\n<td>Toyota</td>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>370Z</td>\r\n<td>3</td>\r\n<td>Nissan</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Observe que a coluna CODIGOMARCA aparece nas duas rela&ccedil;&otilde;es, sendo apto para a jun&ccedil;&atilde;o natural. O resultado seria equivalente a seguinte consulta:</p>\r\n<p><code>&sigma; Modelos.CODIGOMARCA = Marcas.CODIGOMARCA (Modelos X Marcas)</code></p>\r\n<blockquote>\r\n<p><strong>O que voc&ecirc; fez?</strong> Como a coluna CODIGOMARCA aparece nas duas tuplas, eu referenciei o nome da rela&ccedil;&atilde;o antes do nome da coluna, seguido de um ponto, para evitar ambiguidade. No nosso site voc&ecirc; pode usar esta nota&ccedil;&atilde;o, que est&aacute; presente na SQL.</p>\r\n</blockquote>\r\n<p>A seguir, nos exerc&iacute;cios voc&ecirc; praticar&aacute; mais estes conceitos. E nas pr&oacute;ximas li&ccedil;&otilde;es, voc&ecirc; vai aprender outros tipos de jun&ccedil;&otilde;es.</p>'),
(10, 'Outras junÃ§Ãµes: Inner, Left e Right Join', 'outras-juncoes-inner-left-e-right-join', 1, 1, '<blockquote>\r\n<p>Nesta li&ccedil;&atilde;o, voc&ecirc; vai aprender sobre outros tipos de jun&ccedil;&otilde;es existentes na &Aacute;lgebra Relacional.</p>\r\n</blockquote>\r\n<h5>Jun&ccedil;&atilde;o com condi&ccedil;&atilde;o</h5>\r\n<p>A Jun&ccedil;&atilde;o Natural, que voc&ecirc; viu na li&ccedil;&atilde;o anterior, trata de rela&ccedil;&otilde;es que possuem uma coluna em comum. Assim, n&atilde;o pode ser usado para rela&ccedil;&otilde;es onde todas as colunas s&atilde;o diferentes. Para usar a jun&ccedil;&atilde;o nesta situa&ccedil;&atilde;o, voc&ecirc; deve renomear uma das rela&ccedil;&otilde;es ou usar uma jun&ccedil;&atilde;o com condi&ccedil;&atilde;o.</p>\r\n<p>Uma jun&ccedil;&atilde;o com condi&ccedil;&atilde;o funciona basicamente da mesma maneira que a Jun&ccedil;&atilde;o Natural. Voc&ecirc; especifica duas rela&ccedil;&otilde;es a serem combinadas, e uma condi&ccedil;&atilde;o de jun&ccedil;&atilde;o que filtra quais tuplas ser&atilde;o selecionadas pela rela&ccedil;&atilde;o resultante. Sua sintaxe b&aacute;sica &eacute;:&nbsp;</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA} {s&iacute;mbolo} ({condicao}) {relacaoB}</span></p>\r\n<p>Uma condi&ccedil;&atilde;o de jun&ccedil;&atilde;o &eacute; uma condi&ccedil;&atilde;o simples de igualdade, que referencia uma tupla de cada rela&ccedil;&atilde;o envolvida.</p>\r\n<p>A seguir, vamos explicar as diferen&ccedil;as entre cada operador de jun&ccedil;&atilde;o na &Aacute;lgebra Relacional.&nbsp;</p>\r\n<blockquote>\r\n<p>Exemplo a ser usado nesse texto:&nbsp;</p>\r\n<p>Rela&ccedil;&atilde;o Funcion&aacute;rios</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>idDep</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Luis</td>\r\n<td style=\"text-align: center;\">1</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Luciano</td>\r\n<td style=\"text-align: center;\">3</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Ant&ocirc;nio</td>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">4</td>\r\n<td style=\"text-align: center;\">Andressa</td>\r\n<td style=\"text-align: center;\">3</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">5</td>\r\n<td style=\"text-align: center;\">Z&eacute; das Couves</td>\r\n<td style=\"text-align: center;\">2</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Rela&ccedil;&atilde;o&nbsp;Departamentos</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idDep</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeDep</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Financeiro</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Log&iacute;stica</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">4</td>\r\n<td style=\"text-align: center;\">F&aacute;brica</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</blockquote>\r\n<h5>Inner Join (â¨)</h5>\r\n<p>Funciona de forma semelhante a Jun&ccedil;&atilde;o Natural, por&eacute;m voc&ecirc; estabelece quais colunas ser&atilde;o usadas de filtro na jun&ccedil;&atilde;o. S&oacute; ser&atilde;o colocadas na rela&ccedil;&atilde;o somente as tuplas que tiverem o mesmo valor em ambas as colunas selecionadas. Sua sintaxe &eacute;:</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA} â¨&nbsp;({condicao}) {relacaoB}</span></p>\r\n<p>Exemplo: Funcion&aacute;rios&nbsp;â¨ (Funcionarios.idDep = Departamentos.idDep) Departamentos:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idDep</strong></td>\r\n<td style=\"text-align: center;\"><strong>idFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeDep</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Lu&iacute;s</td>\r\n<td style=\"text-align: center;\">Financeiro</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">5</td>\r\n<td style=\"text-align: center;\">Z&eacute; das Couves</td>\r\n<td style=\"text-align: center;\">Log&iacute;stica</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Luciano</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">4</td>\r\n<td style=\"text-align: center;\">Andressa</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h5>Left Outer Join (âŸ•)</h5>\r\n<p>Tem um funcionamento semelhante ao Inner Join, mas com uma diferen&ccedil;a peculiar. Todas as tuplas da tabela da esquerda, s&atilde;o selecionadas, independente se haja correspond&ecirc;ncia com a rela&ccedil;&atilde;o esquerda ou n&atilde;o. O filtro s&oacute; &eacute; aplicado as tuplas da tabela da direita.</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA}&nbsp;âŸ• ({condicao}) {relacaoB}</span></p>\r\n<p>Exemplo: Funcion&aacute;rios&nbsp;âŸ• (Funcionarios.idDep = Departamentos.idDep) Departamentos:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idDep</strong></td>\r\n<td style=\"text-align: center;\"><strong>idFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeDep</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Lu&iacute;s</td>\r\n<td style=\"text-align: center;\">Financeiro</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">5</td>\r\n<td style=\"text-align: center;\">Z&eacute; das Couves</td>\r\n<td style=\"text-align: center;\">Log&iacute;stica</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Luciano</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">4</td>\r\n<td style=\"text-align: center;\">Andressa</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Ant&ocirc;nio</td>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<blockquote>\r\n<p>Observe que para as tuplas com colunas sem correspond&ecirc;ncia, como no caso do funcion&aacute;rio Ant&ocirc;nio, &eacute; atr&iacute;buido o valor <em>{nulo} </em>as colunas que n&atilde;o tiverem valores.</p>\r\n</blockquote>\r\n<h5>Right Outer Join (âŸ–)</h5>\r\n<p>Semelhante ao Left Outer Join, com a diferen&ccedil;a de se selecionar todas as tuplas da rela&ccedil;&atilde;o da direita, mesmo aquelas que n&atilde;o tiverem correspond&ecirc;ncia com a rela&ccedil;&atilde;o esquerda. A condi&ccedil;&atilde;o s&oacute; &eacute; aplicada as tuplas da rela&ccedil;&atilde;o da esquerda.</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA}&nbsp;âŸ– ({condicao}) {relacaoB}</span></p>\r\n<p>Exemplo: Funcion&aacute;rios&nbsp;âŸ– (Funcionarios.idDep = Departamentos.idDep) Departamentos:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idDep</strong></td>\r\n<td style=\"text-align: center;\"><strong>idFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeDep</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Lu&iacute;s</td>\r\n<td style=\"text-align: center;\">Financeiro</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">5</td>\r\n<td style=\"text-align: center;\">Z&eacute; das Couves</td>\r\n<td style=\"text-align: center;\">Log&iacute;stica</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Luciano</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">4</td>\r\n<td style=\"text-align: center;\">Andressa</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">4</td>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n<td style=\"text-align: center;\">F&aacute;brica</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h5>Full Outer Join (âŸ—)</h5>\r\n<p>Esse operador seleciona todas as tuplas das duas rela&ccedil;&otilde;es, mesmo que uma n&atilde;o tenha rela&ccedil;&atilde;o com a outra.</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA}&nbsp;âŸ— ({condicao}) {relacaoB}</span></p>\r\n<p>Exemplo: Funcion&aacute;rios&nbsp;âŸ— (Funcionarios.idDep = Departamentos.idDep) Departamentos:</p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td style=\"text-align: center;\"><strong>idDep</strong></td>\r\n<td style=\"text-align: center;\"><strong>idFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeFunc</strong></td>\r\n<td style=\"text-align: center;\"><strong>nomeDep</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">1</td>\r\n<td style=\"text-align: center;\">Lu&iacute;s</td>\r\n<td style=\"text-align: center;\">Financeiro</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">5</td>\r\n<td style=\"text-align: center;\">Z&eacute; das Couves</td>\r\n<td style=\"text-align: center;\">Log&iacute;stica</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">2</td>\r\n<td style=\"text-align: center;\">Luciano</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">4</td>\r\n<td style=\"text-align: center;\">Andressa</td>\r\n<td style=\"text-align: center;\">RH</td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n<td style=\"text-align: center;\">3</td>\r\n<td style=\"text-align: center;\">Ant&ocirc;nio</td>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n</tr>\r\n<tr>\r\n<td style=\"text-align: center;\">4</td>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n<td style=\"text-align: center;\"><em>{nulo}</em></td>\r\n<td style=\"text-align: center;\">F&aacute;brica</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Para ilustrar melhor, observe esta imagem, demonstrando os tipos de jun&ccedil;&otilde;es existentes:</p>\r\n<p><a href=\"../images/join.png\" target=\"_blank\" rel=\"noopener noreferrer\"><img class=\"responsive-img\" style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../images/join.png\" /></a></p>\r\n<p>&nbsp;</p>\r\n<p><em>Clique na imagem para abrir em nova janela. Extra&iacute;do de <a href=\"https://edwarcardona.files.wordpress.com/2013/03/sql_server_joins.jpg\">https://edwarcardona.files.wordpress.com/2013/03/sql_server_joins.jpg</a></em><em>, acesso em 01 jun. 2017.</em></p>\r\n<p>A seguir, voc&ecirc; vai resolver exerc&iacute;cios envolvendo esses operadores.</p>');
INSERT INTO `Licoes` (`id`, `nome`, `slug`, `idMantenedorCriou`, `idMantenedorAlterou`, `textoLicao`) VALUES
(12, 'ExercÃ­cios de ReforÃ§o I - Produto e Joins', 'exercicios-de-reforco-i-produto-e-joins', 1, 1, '<p>A seguir, voc&ecirc; vai refor&ccedil;ar os conte&uacute;dos que voc&ecirc; aprendeu previamente.</p>\r\n<p>Mas, se voc&ecirc; n&atilde;o se lembra de alguns assuntos que n&oacute;s abordamos, o texto abaixo pode te interessar.</p>\r\n<h5>Operadores b&aacute;sicos</h5>\r\n<p>Proje&ccedil;&atilde;o:&nbsp;<code style=\"width: auto;\">&Pi; coluna1, coluna2, ..., colunaN(rela&ccedil;&atilde;o)</code></p>\r\n<p>Sele&ccedil;&atilde;o:&nbsp;<code style=\"width: auto;\">&sigma; condicao(rela&ccedil;&atilde;o)</code></p>\r\n<p>&Eacute; considerado uma rela&ccedil;&atilde;o uma tabela ou um resultado de uma consulta. Assim, consultas podem ser aninhadas. Veja esse exemplo:</p>\r\n<p><code style=\"width: auto;\">&Pi; idcli (&sigma; idcli &gt; 9 (cliente))</code></p>\r\n<p>Operadores de Condi&ccedil;&atilde;o:&nbsp;&lt;, &gt;, =,&nbsp;&le;,&nbsp;&ge;, e&nbsp;&ne;. Para unir duas ou mais condi&ccedil;&otilde;es, use:&nbsp;â‹€ (E),&nbsp;â‹ (OU).</p>\r\n<p>Atribui&ccedil;&atilde;o de Consultas:&nbsp;<code style=\"width: auto;\">{identificador} &larr; {relacao}</code>, onde uma rela&ccedil;&atilde;o pode ser um nome de tabela ou um resultado de uma consulta em &Aacute;lgebra Relacional.</p>\r\n<h5>Uni&atilde;o, Intersec&ccedil;&atilde;o e Diferen&ccedil;a</h5>\r\n<ol>\r\n<li>Uni&atilde;o (&cup;):&nbsp;Dadas as rela&ccedil;&otilde;es A e B, a opera&ccedil;&atilde;o&nbsp;<code style=\"width: auto;\">A &cup; B</code>&nbsp;retorna todas as tuplas que estiverem em R ou em S ou em ambas as rela&ccedil;&otilde;es.</li>\r\n<li>Intersec&ccedil;&atilde;o (&cap;):&nbsp;Dadas as mesmas rela&ccedil;&otilde;es A e B, uma opera&ccedil;&atilde;o&nbsp;<code style=\"width: auto;\">A &cap; B</code>&nbsp;retorna todas as tuplas que estiverem tanto na rela&ccedil;&atilde;o A quanto na rela&ccedil;&atilde;o B, ou seja, estejam presentes nas duas rela&ccedil;&otilde;es.</li>\r\n<li>Diferen&ccedil;a ou Exceto (-):&nbsp;Sendo A e B rela&ccedil;&otilde;es, uma opera&ccedil;&atilde;o&nbsp;<code style=\"width: auto;\">A - B</code>&nbsp;retorna todas as tuplas que est&atilde;o em A&nbsp;<span style=\"text-decoration: underline;\">mas n&atilde;o est&atilde;o em</span>&nbsp;B.</li>\r\n</ol>\r\n<h5>Produto Cartesiano</h5>\r\n<p>Tamb&eacute;m denominado de&nbsp;Produto Cruzado&nbsp;por alguns autores, &eacute; uma opera&ccedil;&atilde;o bin&aacute;ria, mas n&atilde;o obriga que as rela&ccedil;&otilde;es envolvidas sejam compat&iacute;veis pela uni&atilde;o. Seu funcionamento &eacute; bastante simples, dadas duas rela&ccedil;&otilde;es A e B, um produto cartesiano entre essas opera&ccedil;&otilde;es (denotada na express&atilde;o A X B) produz uma nova rela&ccedil;&atilde;o combinando cada tupla de A com cada tupla de B.&nbsp;</p>\r\n<h5>Jun&ccedil;&atilde;o Natural</h5>\r\n<p>Combina duas rela&ccedil;&otilde;es&nbsp;<span style=\"text-decoration-line: underline;\">que possuem um atributo com mesmo nome em comum</span>, filtrando as tuplas que possu&iacute;rem o mesmo valor nesse atributo.</p>\r\n<h5>Inner Join (â¨)</h5>\r\n<p>Funciona de forma semelhante a Jun&ccedil;&atilde;o Natural, por&eacute;m voc&ecirc; estabelece quais colunas ser&atilde;o usadas de filtro na jun&ccedil;&atilde;o. S&oacute; ser&atilde;o colocadas na rela&ccedil;&atilde;o somente as tuplas que tiverem o mesmo valor em ambas as colunas selecionadas. Sua sintaxe &eacute;:</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA} â¨&nbsp;({condicao}) {relacaoB}</span></p>\r\n<p>Exemplo: Funcion&aacute;rios&nbsp;â¨ (Funcionarios.idDep = Departamentos.idDep) Departamentos</p>\r\n<h5>Left Outer Join (âŸ•)</h5>\r\n<p>Tem um funcionamento semelhante ao Inner Join, mas com uma diferen&ccedil;a peculiar. Todas as tuplas da tabela da esquerda, s&atilde;o selecionadas, independente se haja correspond&ecirc;ncia com a rela&ccedil;&atilde;o esquerda ou n&atilde;o. O filtro s&oacute; &eacute; aplicado as tuplas da tabela da direita.</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA}&nbsp;âŸ• ({condicao}) {relacaoB}</span></p>\r\n<p>Exemplo: Funcion&aacute;rios&nbsp;âŸ• (Funcionarios.idDep = Departamentos.idDep) Departamentos</p>\r\n<h5 style=\"line-height: 27.06px;\">Right Outer Join (âŸ–)</h5>\r\n<p>Semelhante ao Left Outer Join, com a diferen&ccedil;a de se selecionar todas as tuplas da rela&ccedil;&atilde;o da direita, mesmo aquelas que n&atilde;o tiverem correspond&ecirc;ncia com a rela&ccedil;&atilde;o esquerda. A condi&ccedil;&atilde;o s&oacute; &eacute; aplicada as tuplas da rela&ccedil;&atilde;o da esquerda.</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA}&nbsp;âŸ– ({condicao}) {relacaoB}</span></p>\r\n<p>Exemplo: Funcion&aacute;rios&nbsp;âŸ– (Funcionarios.idDep = Departamentos.idDep) Departamentos</p>\r\n<h5 style=\"line-height: 27.06px;\">Full Outer Join (âŸ—)</h5>\r\n<p>Esse operador seleciona todas as tuplas das duas rela&ccedil;&otilde;es, mesmo que uma n&atilde;o tenha rela&ccedil;&atilde;o com a outra.</p>\r\n<p><span style=\"font-family: monospace, monospace; text-align: center; background-color: #eeeeee;\">{rela&ccedil;&atilde;oA}&nbsp;âŸ— ({condicao}) {relacaoB}</span></p>\r\n<p>Exemplo: Funcion&aacute;rios&nbsp;âŸ— (Funcionarios.idDep = Departamentos.idDep) Departamentos</p>\r\n<p style=\"line-height: 27.06px; color: rgba(0, 0, 0, 0.87); font-family: Roboto, sans-serif;\"><span style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 14px;\">Bom trabalho!</span></p>'),
(13, 'Agrupamento e FunÃ§Ãµes Estendidas', 'agrupamento-e-funcoes-estendidas', 1, 1, '<blockquote>\r\n<p>Nesta li&ccedil;&atilde;o, voc&ecirc; vai aprender sobre fun&ccedil;&otilde;es agregadas e estendidas e como fazer sele&ccedil;&atilde;o com agrupamento.</p>\r\n</blockquote>\r\n<h5>Fun&ccedil;&otilde;es estendidas</h5>\r\n<p>As fun&ccedil;&otilde;es estendidas trata-se da capacidade de atribuir express&otilde;es aritim&eacute;ticas a uma coluna, para alterar os dados a serem exibidos. Para tanto, voc&ecirc; pode usar adi&ccedil;&atilde;o (+), subtra&ccedil;&atilde;o (-), divis&atilde;o (/) e multiplica&ccedil;&atilde;o (*).</p>\r\n<p>Veja os seguintes exemplos:</p>\r\n<p>1 - Fa&ccedil;a uma consulta que selecione&nbsp;o id da fita (idfil e ordfita), o pre&ccedil;o de custo original e o pre&ccedil;o de custo com adi&ccedil;&atilde;o de 2 reais.</p>\r\n<p><code>&Pi; idfil, ordfita, precocusto, precocusto+2 (fita)&nbsp;</code></p>\r\n<p>2 - Fa&ccedil;a uma consulta que selecione&nbsp;o id da fita (idfil e ordfita), o pre&ccedil;o de custo original e o pre&ccedil;o de custo com redu&ccedil;&atilde;o&nbsp;de 3 reais.</p>\r\n<p><code>&Pi; idfil, ordfita, precocusto, precocusto-3 (fita)&nbsp;</code></p>\r\n<p>3 - Fa&ccedil;a uma consulta que selecione&nbsp;o id da fita (idfil e ordfita), o pre&ccedil;o de custo original e o pre&ccedil;o de custo com redu&ccedil;&atilde;o de 50% (metade do pre&ccedil;o).</p>\r\n<p><code>&Pi; idfil, ordfita, precocusto, precocusto/2 (fita)&nbsp;</code></p>\r\n<p>1 - Fa&ccedil;a uma consulta que selecione&nbsp;o id da fita (idfil e ordfita), o pre&ccedil;o de custo original e o pre&ccedil;o de custo com adi&ccedil;&atilde;o de 20%.</p>\r\n<p><code>&Pi; idfil, ordfita, precocusto, precocusto*1.2 (fita)</code></p>\r\n<blockquote>\r\n<p>Neste site, n&uacute;meros reais s&atilde;o representados com ponto, n&atilde;o v&iacute;rgula.</p>\r\n</blockquote>\r\n<h5>Fun&ccedil;&otilde;es Agregadas</h5>\r\n<p>As fun&ccedil;&otilde;es agregadas s&atilde;o &uacute;teis para extrair estat&iacute;sticas de uma rela&ccedil;&atilde;o. A &Aacute;lgebra Relacional Formal n&atilde;o especifica fun&ccedil;&otilde;es para trabalhar nesses dados. Esta lacuna foi preenchida pela &Aacute;lgebra Relacional Estendida, que define algumas fun&ccedil;&otilde;es para serem trabalhadas no banco. Neste site, voc&ecirc; pode usar as seguintes fun&ccedil;&otilde;es:</p>\r\n<ol>\r\n<li>SUM(coluna): Conta todos os valores de uma coluna;</li>\r\n<li>MAX(coluna): Retorna o maior&nbsp;valor de uma coluna;</li>\r\n<li>MIN(coluna): Retorna o menor valor de uma coluna;</li>\r\n<li>AVG(coluna): Retorna a m&eacute;dia dos valores de uma coluna e&nbsp;</li>\r\n<li>COUNT(coluna): Conta o n&uacute;mero de ocorr&ecirc;ncias n&atilde;o-nulas de uma coluna. Voc&ecirc; pode usar essa fun&ccedil;&atilde;o para contar o n&uacute;mero de registros retornados, atrav&eacute;s da sintaxe COUNT(*) (mais detalhes em: <a href=\"http://blog.alura.com.br/select-count-count1-e-countnome-a-batalha-dos-counts-de-sql/\" target=\"_blank\" rel=\"noopener noreferrer\">http://blog.alura.com.br/select-count-count1-e-countnome-a-batalha-dos-counts-de-sql/</a>).</li>\r\n</ol>\r\n<p>Voc&ecirc; pode usar essas fun&ccedil;&otilde;es em uma proje&ccedil;&atilde;o, ou em um agrupamento, que veremos a seguir.</p>\r\n<h5>Agrupamento</h5>\r\n<p>A agrupamento&nbsp;faz uma consulta estendida ao banco de dados, pois al&eacute;m de voc&ecirc; especificar as colunas (com as suas fun&ccedil;&otilde;es estendidas), voc&ecirc; indicar&aacute; uma coluna que servir&aacute; de par&acirc;metro para a agrupamento dos dados. &Eacute; &uacute;til para trabalhar com grupos menores de dados.</p>\r\n<p>A sintaxe do comando &eacute; esta:</p>\r\n<p><code>&upsih; colunaAgrupadora, coluna1, coluna2, ..., colunaN(rela&ccedil;&atilde;o)</code></p>\r\n<p>A <code>colunaAgrupadora</code> &eacute; a coluna que servir&aacute; de par&acirc;metro para agrupar os dados, enquanto que as demais colunas da lista ser&atilde;o listadas na rela&ccedil;&atilde;o, semelhante a uma proje&ccedil;&atilde;o.</p>\r\n<p>Vejamos a um exemplo: Fa&ccedil;a um relat&oacute;rio de quantidade de fitas por g&ecirc;nero.</p>\r\n<p><code>&upsih; idgen, COUNT(*)(filme)</code></p>\r\n<table class=\"responsive-table centered striped\">\r\n<thead>\r\n<tr>\r\n<th>idgen</th>\r\n<th>count</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>6</td>\r\n<td>2</td>\r\n</tr>\r\n<tr>\r\n<td>14</td>\r\n<td>3</td>\r\n</tr>\r\n<tr>\r\n<td>17</td>\r\n<td>3</td>\r\n</tr>\r\n<tr>\r\n<td>12</td>\r\n<td>6</td>\r\n</tr>\r\n<tr>\r\n<td>(...)</td>\r\n<td>(...)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Os dados s&atilde;o agrupados pela coluna <code>idgen</code>, que representa o g&ecirc;nero.</p>\r\n<p>Outro exemplo: Sabendo que a coluna idfil representa um filme em uma fita, fa&ccedil;a uma consulta que liste o maior pre&ccedil;o de custo de uma fita de cada filme no sistema.</p>\r\n<p><code>&upsih; idfil, MAX(precocusto) (fita)</code></p>\r\n<table class=\"responsive-table centered striped\">\r\n<thead>\r\n<tr>\r\n<th>idfil</th>\r\n<th>max</th>\r\n</tr>\r\n</thead>\r\n<tbody>\r\n<tr>\r\n<td>129</td>\r\n<td>10</td>\r\n</tr>\r\n<tr>\r\n<td>106</td>\r\n<td>10</td>\r\n</tr>\r\n<tr>\r\n<td>120</td>\r\n<td>12</td>\r\n</tr>\r\n<tr>\r\n<td>156</td>\r\n<td>10</td>\r\n</tr>\r\n<tr>\r\n<td>(...)</td>\r\n<td>(...)</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;A seguir, voc&ecirc; vai resolver alguns exerc&iacute;cios.</p>'),
(15, 'ExercÃ­cio de ReforÃ§o III - Parte Final', 'exercicio-de-reforco-iii-parte-final', 1, NULL, '<p>A seguir, vamos fazer os &uacute;ltimos exerc&iacute;cios, para refor&ccedil;ar todos os conte&uacute;dos dados.</p>\r\n<p>Bom trabalho.</p>'),
(14, 'RenomeaÃ§Ã£o, OrdenaÃ§Ã£o e Eliminador de Duplicatas', 'renomeacao-ordenacao-e-eliminador-de-duplicatas', 1, 1, '<blockquote>\r\n<p>Nesta li&ccedil;&atilde;o, voc&ecirc; ir&aacute; aprender os operadores de Renomea&ccedil;&atilde;o e Ordena&ccedil;&atilde;o de Consultas</p>\r\n</blockquote>\r\n<h5>Renomea&ccedil;&atilde;o</h5>\r\n<p>&Eacute; usado para dar um novo nome a uma rela&ccedil;&atilde;o como todo ou a colunas de uma rela&ccedil;&atilde;o. Sua sintaxe &eacute;:</p>\r\n<p>Para renomear uma rela&ccedil;&atilde;o: <code>&rho; (relacao)</code></p>\r\n<p>Para renomear colunas de uma rela&ccedil;&atilde;o: <code>&rho; [novoNome1, novoNome2, ..., novoNomeM](relacao)</code></p>\r\n<h5>Ordena&ccedil;&atilde;o</h5>\r\n<p>Especifica quais colunas ser&atilde;o usadas para especificar a ordem de exibi&ccedil;&atilde;o das tuplas da tabela. Sua sintaxe &eacute;:</p>\r\n<pre><code>&tau; coluna1, ..., colunan(rela&ccedil;&atilde;o)</code></pre>\r\n<blockquote>\r\n<p><strong>Nota: </strong>A ordem usada &eacute; a crescente.</p>\r\n</blockquote>\r\n<h5>Eliminador de Duplicatas</h5>\r\n<p>Na &Aacute;lgebra Relacional Formal, as duplicatas s&atilde;o automaticamente eliminadas. Mas isto n&atilde;o vale no nosso site, por uma quest&atilde;o de projeto. Para que voc&ecirc; elimine as duplicatas da rela&ccedil;&atilde;o, basta usar a seguinte sintaxe:</p>\r\n<p><code>&delta; (rela&ccedil;&atilde;o)</code></p>\r\n<p>&nbsp;</p>');
